import React from 'react'
import { useEffect, useState } from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import axios from '../api/axios'

const USER_REGEX = /^[A-z][A-z0-9-_]{3,23}$/
// const PWD_REGEX = /^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#$%]).{8,24}$/
const EMAIL_REGEX = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/
const REGISTER_URL = '/register'

const Register = ({ history }) => {
  //Use state for name
  const [name, setName] = useState('')
  const [validName, setValidName] = useState(false)

  //Use state for password and match password
  const [password, setPassword] = useState('')
  //   const [validPassword, setValidPassword] = useState(false)

  const [confirmPassword, setConfirmPassword] = useState('')
  const [validConfirmPassword, setValidConfirmPassword] = useState(false)

  //Use state for username
  const [username, setUsername] = useState('')
  const [validUsername, setValidUsername] = useState(false)

  //Use state for email
  const [email, setEmail] = useState('')
  const [validEmail, setValidEmail] = useState(false)

  //Use state for error message and success
  const [errMsg, setErrMsg] = useState('')
  const [success, setSuccess] = useState(false)

  useEffect(() => {
    setValidUsername(USER_REGEX.test(username))
  }, [username])

  useEffect(() => {
    setValidEmail(EMAIL_REGEX.test(email))
  }, [email])

  useEffect(() => {
    setValidConfirmPassword(password === confirmPassword)
  }, [password, confirmPassword])

  useEffect(() => {
    setErrMsg('')
  }, [name, password, confirmPassword])

  const handleSubmit = async (e) => {
    e.preventDefault()
    const v1 = USER_REGEX.test(name)
    // const v2 = PWD_REGEX.test(password)
    if (!v1) {
      setErrMsg('Invalid Entry')
      return
    }
    // console.log(username)
    // console.log(email)
    // console.log(name)

    try {
      const response = await axios.post(
        REGISTER_URL,
        JSON.stringify({
          name: name,
          username: username,
          email: email,
          password: password,
        }),
        {
          headers: {
            'Content-Type': 'application/json',
            'Access-Control-Allow-Origin': '*',
          },

          withCredentials: false,
        }
      )
      // console.log(response)
      sessionStorage.setItem('username', username)
      history.push('/OtpVerify')
    } catch {
      setErrMsg('Invalid Entry')
      alert('error occured')
    }
  }

  return (
    <Wrapper>
      <h1>Register Yourself</h1>
      <div>
        <form onSubmit={handleSubmit}>
          {/* For Name */}
          <input
            type='text'
            id='name'
            autoComplete='off'
            onChange={(e) => {
              setName(e.target.value)
            }}
            value={name}
            required
            placeholder='Name'
          />
          {/* For Username */}
          <input
            type='text'
            id='username'
            autoComplete='off'
            onChange={(e) => {
              setUsername(e.target.value)
            }}
            value={username}
            required
            placeholder='Username'
          />
          {/* For Email */}
          <input
            type='email'
            id='email'
            autoComplete='off'
            onChange={(e) => {
              setEmail(e.target.value)
            }}
            value={email}
            required
            placeholder='Email'
          />
          {/* For Password and Confirm Password */}
          <input
            type='password'
            id='password'
            autoComplete='off'
            onChange={(e) => {
              setPassword(e.target.value)
            }}
            value={password}
            required
            placeholder='Password'
          />
          <input
            type='password'
            id='confirmPassword'
            autoComplete='off'
            onChange={(e) => {
              setConfirmPassword(e.target.value)
            }}
            value={confirmPassword}
            required
            placeholder='Enter password again'
          />

          <button
            disabled={
              !validConfirmPassword || !validEmail || !validUsername
                ? true
                : false
            }
          >
            Sign Up
          </button>
          <p style={{ 'margin-top': '1.5rem', 'margin-left': '7.2rem' }}>
            Already have an account? <Link to='/login'>Login</Link> here.
          </p>
        </form>
      </div>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  width: 600px;
  /* height: 800px; */
  margin: 0 auto;
  background-color: #fcfcfc;
  padding: 20px 50px 40px;
  box-shadow: 1px 4px 10px 1px #aaa;
  font-family: sans-serif;

  * {
    box-sizing: border-box;
  }

  h2 {
    text-align: center;
    margin-bottom: 30px;
  }

  input {
    margin-bottom: 15px;
  }

  input {
    display: block;
    height: 32px;
    padding: 6px 16px;
    width: 100%;
    border: none;
    background-color: #f3f3f3;
  }
  label {
    color: #777;
    font-size: 0.8em;
  }

  button {
    display: block;
    margin: 20px auto 0;
    width: 150px;
    height: 40px;
    border-radius: 25px;
    border: none;
    color: #eee;
    font-weight: 700;
    font-size: 15px;
    box-shadow: 1px 4px 10px 1px #aaa;

    background: var(--buttonColor);
  }
  button:hover {
    background: black;
  }
`

export default Register
